import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from './user.service';
import { IUser } from './user';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
})
export class RegisterComponent {
  userForm: FormGroup;

  constructor(
    private userService: UserService,
    private router: Router,
    private formBuilder: FormBuilder
  ) {
    this.userForm = this.formBuilder.group({
      Name: ['', Validators.required],
      Email: ['', [Validators.required, Validators.email]],
      Phone: ['', Validators.required],
      Password: ['', Validators.required],
    });
  }

  async register() {
    console.log('User Registration form submitted');
    console.log(this.userForm);

    if (this.userForm.invalid) {
      console.log('Form is invalid. Registration aborted.');
      console.log('Form errors:', this.userForm.errors);
      return;
    }

    const newUser: IUser = this.userForm.value;

    try {
      const response = await (await this.userService.register(newUser)).toPromise();
      console.log('Registration successful:', response);
      this.router.navigate(['/']);
    } catch (error) {
      console.error('Registration failed:', error);
    }
  }



  cancel() {
    this.router.navigate(['/']);
  }
}
<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title></title>
</head>
<body>
  <!-- register.component.html -->
  <div class="container mt-5">
    <form (ngSubmit)="register()" class="needs-validation">
      <div class="form-group">
        <label for="name">Name:</label>
        <input type="text" id="name" class="form-control bg-light" [(ngModel)]="userForm.value.Name" name="name" required>
      </div>

      <div class="form-group">
        <label for="email">Email:</label>
        <input type="email" id="email" class="form-control bg-light" [(ngModel)]="userForm.value.Email" name="email" required>
      </div>

      <div class="form-group">
        <label for="phone">Phone:</label>
        <input type="tel" id="phone" class="form-control bg-light" [(ngModel)]="userForm.value.Phone" name="phone" required>
      </div>

      <div class="form-group">
        <label for="password">Password:</label>
        <input type="password" id="password" class="form-control bg-light" [(ngModel)]="userForm.value.Password" name="password" required>
      </div>

      <br />
      <button type="submit" class="btn btn-primary">Register</button>
      <button type="button" class="btn btn-secondary ml-2" (click)="cancel()">Cancel</button>
    </form>
  </div>

</body>
</html>
